var daysValuesNotProvidedFilterParams = {
    comparator: function (a, b) {
        var aIndex = listOfDays.indexOf(a);
        var bIndex = listOfDays.indexOf(b);
        if (aIndex === bIndex)
            return 0;
        return aIndex > bIndex ? 1 : -1;
    }
};

