function getRowData() {
    var weekdays = [
        'Monday',
        'Tuesday',
        'Wednesday',
        'Thursday',
        'Friday'
    ];
    var rows = [];
    for (var i = 0; i < 200; i++) {
        var index = Math.floor(Math.random() * 5);
        rows.push({ days: weekdays[index] });
    }
    return rows;
}
